import React, { useContext } from 'react';
import { RoomContext } from './context';

const FeatureRoom = () => {
  const { name, greeting } = useContext(RoomContext);
  //  함수형이라면 static contextType = RoomContext 이렇게 써야 함.

  return <div>hello feature {name}</div>;
};

export default FeatureRoom;
